Let's think step by step. By definition of absolute value in the complex plane, $|a+bi|\leq 5$ is equivalent to $\sqrt{a^{2}+b^{2}}\leq 5$. Squaring both sides of the equation yields $a^{2}+b^{2}\leq 25$, because squaring preserves inequality when dealing with non-negative real numbers. Thus, we need to count all integer lattice points on or inside the circle defined by $x^{2}+y^{2}=25$. To do so, let's list out the possible combinations of $(a,b)$ satisfying our conditions: 
$(0,0)$; 
$(\pm3,0)$;
$(0,\pm3)$;
$(\pm4,0)$;
$(0,\pm4)$;
$(\pm5,0)$;
$(0,\pm5)$;
$(\pm4,\pm3)$;
$(\pm3,\pm4)$.
There are $\boxed{13}$ ordered pairs in total. The answer is: 13.
